import React from 'react';
import { StyleSheet, Text, View, ScrollView } from 'react-native';

export default function Home(){
    return(
        <Text style={styles.blue}>Hello</Text>
    )
}
const styles = StyleSheet.create({
    blue:{
        fontSize: 25,
        color:'lightblue',
      },
})
